import React from 'react';
import '../../node_modules/bootstrap/dist/css/bootstrap.css';

const Form = props => {
    return(
        <div>
            <div className="row">
                <div className="col-sm-2"></div>
                <div className="col-sm-8">
                    <form >
                        <div className="form-group">
                            <label>Name</label>
                            <input type="text" name="name" className="form-control" />
                            {/* {
                                props.error.name ?
                                    <span className="text-danger">{props.error.name.message}</span>
                                    : ""
                            } */}
                        </div>
                        <div className="form-group">
                            <label>Species</label>
                            <input type="text" name="species" className="form-control" />
                            {/* {
                                props.error.species ?
                                    <span className="text-danger">{props.error.species.message}</span>
                                    : ""
                            } */}
                        </div>
                        <div className="form-group">
                            <label>Role</label>
                            <input type="text" name="role" className="form-control" />
                            {/* {
                                props.error.role ?
                                    <span className="text-danger">{props.error.role.message}</span>
                                    : ""
                            } */}
                        </div>
                        <div className="form-group">
                            <label>Special Ability</label>
                            <input type="text" name="specialAbility" className="form-control" />
                            {/* {
                                props.error.specialAbility ?
                                    <span className="text-danger">{props.error.specialAbility.message}</span>
                                    : ""
                            } */}
                        </div>
                        <div className="form-group">
                            <label>Age</label>
                            <input type="text" name="age" className="form-control" />
                            {/* {
                                props.error.age ?
                                    <span className="text-danger">{props.error.age.message}</span>
                                    : ""
                            } */}
                        </div>

                        <input type="submit" value="Submit" className="btn btn-info"/>
                    </form>
                </div>
                <div className="col-sm-2"></div>
            </div>
        </div>
    )
}

export default Form;
